    const [title,setTitle] = useState("LandingPage");

    return (
            <Container fluid>

      <Row fluid>
        <Col>
            <Image  src={require("../assets/c8aa7a41b257939d2ee64cc128b297ec.jpg")} fluid/>
        </Col>
        <Col>
            <Image  src={require("../assets/c8aa7a41b257939d2ee64cc128b297ec.jpg")} fluid/>
        </Col>
      </Row>


            </Container>

    );
};

export default LandingPage;
